import './App.css';
import React from "react";

function App(props) {
    return (<SocketContext.Provider value={socket}>
        <div className="App">
            <header className="App-header">
                <p>
                    You're the client number {props.clientNumber}
                </p>
            </header>
        </div>
    </SocketContext.Provider>);
}

export default App;
